import React from 'react';
import './Header.css';

{/* Header will go here */}


export default Header;


function Header() {
    return (
         <header className="header">
            <nav className="header-nav">
                <a href="/" color>Home</a>
                <a href="/about">About</a>
                <a href="/services">Services</a>
                <a href="/contact">Contact</a>
            </nav>
        </header>
    );
}
